import React, { Component } from "react";
import { withRouter } from "react-router-dom";
import error from "../img/404.svg";
class NotFound extends Component {
  state = {};
  render() {
    console.log(this.props);
    return (
      <div className="col-lg-10 result-notfound text-center">
        <img src={error} alt="" />
        <span>متاسفانه صفحه مورد نظر یافت نشد.</span>
        <button className="btn pageNotFound" onClick={() => this.props.history.goBack()}>بازگشت</button>
      </div>
    );
  }
}

export default withRouter(NotFound);
